import Project from './Project';
import './style.css';

function Work() {

   const porefection = {
      title: 'Porefect Skincare',
      mockupPath: '/assets/work/porefection/desktop-mockup.png',
      deployedLink: 'https://porefect.herokuapp.com',
      repoLink: 'https://github.com/jittel/combo-skincare',
      team: [
         {
            name: 'Isis Alexander',
            role: 'Project Manager'
         },
         {
            name: 'Nate Ginn',
            role: 'Git Admin'
         },
         {
            name: 'Eli Wood',
            role: ''
         },
         {
            name: 'Jaden Storey',
            role: ''
         }
      ],
      tools: [
         'HTML',
         'CSS',
         'Javascript',
         'node.js',
         'Express.js',
         'MySQL 2',
         'Sequelize',
         'bcrypt',
         'Cloudinary'
      ],
      time: '1 Week'
   }

   return (
      <div className="page">
         <Project project={porefection} />
      </div>
   );

}

export default Work;
